import React, { Component } from 'react'
import ApiService from "../../service/ApiService";

class ListRecord extends Component {

    constructor(props) {
        super(props)
        this.state = {
            record: []
        }
        this.reloadUserList = this.reloadUserList.bind(this);
    }

    componentDidMount() {
        this.reloadUserList();
    }

    reloadUserList() {
        ApiService.fetchRecords()
            .then((res) => {
                this.setState({ record: res.data.result })
            });
    }

    render() {
        return (
            <div>
                <h2 className="text-center">Record Details</h2>
                <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>Plate Number</th>
                            <th>Owner</th>
                            <th>Start Date</th>
                            <th>End Date</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.record.length > 0 ? this.state.record.map(
                                record =>
                                    <tr key={record.plate}>
                                        <td>{record.plate}</td>
                                        <td>{record.owner}</td>
                                        <td>{record.start_date}</td>
                                        <td>{record.end_date}</td>
                                    </tr>
                            ) : null
                        }
                    </tbody>
                </table>

            </div>
        );
    }

}

export default ListRecord;
